description:
Мобільний застосунок "Кабінет Водія" дозволяє отримувати актуальні дані про транспортний засіб, посвідчення водія та користуватися послугами сервісних центрів МВС у будь-який час.

Популярні державні послуги МВС та сервіси для автовласників:
- Перевірка та оплата штрафів за порушення ПДР (пошук штрафів в державних реєстрах та отримання актуальної інформації по них);
- Перевірка ТЗ по VIN коду, ПІБ (зручна перевірка даних про транспортний засіб  за двома критеріями);
- Придбання полісу ОСЦПВ онлайн;
- Призначення та скасування належного користувача;
- Відновлення та обмін посвідчення водія;
- Продовження терміну платного зберігання номерних знаків;
- Мапа Безпека дорожнього руху.

Авторизуйтесь завдяки id.gov.ua, Приват24, monobank та Дія.Підпис.

This APP is used in the battery management system, and connects to the active equalizer of the extreme space technology through Bluetooth to realize the parameter display and setting of the active equalizer. The specific function modules are as follows:
-Real-time status monitoring;
-Setting of operating parameters;
-Battery management system equipment control.
